tests.code:
let expectedTitle, expectedChannel, resultTitle, resultChannel;
_youtubePage.default.visiting();
cy.wait(1000);
_youtubePage.default.clickTrending();
cy.wait(1000);
_youtubePage.default.clickMovies();
cy.wait(2000);
_youtubePage.default.getVideo(2).as("selected");
_youtubePage.default.getTitle("@selected").invoke("text").then(text => {
  expectedTitle = text.replace('kr', '').replace('\u00A0', '').trim();
  cy.log("Captured title:", expectedTitle);
});
_youtubePage.default.getChannel("@selected").invoke("text").then(text => {
  expectedChannel = text;
  cy.log("Captured channel:", expectedChannel);
});
_youtubePage.default.clickVideo(2);
cy.wait(2000);
cy.get('ytd-watch-metadata').as("selected");
_youtubePage.default.verifyTitle("@selected").invoke("text").then(text => {
  resultTitle = text.replace('kr', '').replace('\u00A0', '').trim();
  cy.log("Captured title:", resultTitle);
  expect(expectedTitle).to.eq(resultTitle);
});
_youtubePage.default.verifyChannel("@selected").invoke("text").then(text => {
  resultChannel = text;
  cy.log("Captured channel:", resultChannel);
  expect(expectedChannel).to.eq(resultChannel);
});
